function compactarDataParaDict(data) {
  // Garante array
  if (!Array.isArray(data)) return data;

  // Coleta campos √∫nicos na ordem
  const camposUnicos = [];
  data.forEach(obj => {
    Object.keys(obj).forEach(key => {
      if (!camposUnicos.includes(key)) camposUnicos.push(key);
    });
  });

  // data_dict: √≠ndice => campo
  const data_dict = {};
  camposUnicos.forEach((campo, i) => data_dict[i] = campo);

  // Compacta: cada objeto ‚Üí array de valores seguindo a ordem de camposUnicos
  const dadosCompactados = data.map(obj =>
    camposUnicos.map(campo => obj[campo])
  );

  // Resultado final
  return { data_dict, data: dadosCompactados };
}

