function formatarCategoy5(jsonStr) {
  const obj = JSON.parse(jsonStr);
  const bloco = obj["com.acme.myapp_google_br_pt-BR"]?.data;
  if (!Array.isArray(bloco)) return "";

  // Campos essenciais
  const CAMPOS = ["keyword", "position", "change_from_previous_day", "competitivity", "search_volume"];

  // Monta os arrays de valores
  const matriz = bloco.map(item => {
    const campoValor = {};
    (item[0] || []).forEach(attr => { campoValor[attr.field] = attr.value; });
    return CAMPOS.map(campo => campoValor[campo]);
  });

  // Gera string: cada linha √© [valor1, valor2, ...]
  return matriz
    .map(arr => "[" + arr.map(v =>
      typeof v === "string" ? `"${v}"` : v
    ).join(", ") + "]")
    .join(", ");
}


